import React from 'react';
import Sidebar from './sidebar/sidebar';

const Drawertooglerbutton = (props) => {
	return (
		<div >
			<i class="fas fa-bars" onClick={props.click}/>
			
		</div>
	);
};

export default Drawertooglerbutton;
